package problems

import tables.TheGeneticCodesNCBI
import tables.codonUtilsTranslate

/**
 * see also:
 * http://rosalind.info/problems/ptra/
 * https://www.ncbi.nlm.nih.gov/Taxonomy/Utils/wprintgc.cgi
 *
 * Problem

The 20 commonly occurring amino acids are abbreviated by
using 20 letters from the English alphabet (all letters
except for B, J, O, U, X, and Z). Protein strings are
constructed from these 20 symbols. The RNA codon table
shows the encoding from each RNA codon to the amino acid alphabet.

For now, when translating DNA and RNA strings, we will start with
the first letter of the string and ignore stop codons.

Given: A DNA string s of length at most 10 kbp, and a protein string translated by s

Return: The index of the genetic code variant [Table Number] that was used for
translation. (If multiple solutions exist, you may return any one.)
 */


fun main() {

    val dnaString1 =
        ""
    val protein1 =
        ""

    val dnaString2 =
        ""
    val protein2 =
        ""

    val quizDna = ""
    val quizProtein = ""
    // accepted answer is 26!

    val d = quizDna
    val p = quizProtein

    val canon = TheGeneticCodesNCBI()
    val numTables = canon.hashMapTableNumberToName.keys.size

    for (i in 0 until numTables) {
        val result = codonUtilsTranslate(d, isDnaString = false, table = i)

        if (result == p) {
            val canonTableNumber = canon.zeroBasedToCanonicalTableNumberLookup(i)
            val canonTableName = canon.zeroBasedToCanonicalTableNameLookup(i)
            println("Yes!! match at table $i canonical number $canonTableNumber $canonTableName")
        }
    }


}